  false,\n\t\"url\": null,\n\t\"notes\": \"Interpreted geologic history of the Sedro-Woolley
  North and Lyman 7.5-minute quadrangles, western Skagit County, Washington.This report
  presents our interpretation of the geologic history of a significant portion of
  the lower Skagit Valley, focusing on the area in and near the Sedro-Woolley North
  and Lyman 7.5-minute quadrangles. Our interpretation is based on detailed geologic
  mapping in and around the Bow, Alger, Sedro-Woolley North, and Lyman 7.S-minute
  quadrangles from 1997 to 1999 (FIg. 1). Downloadable file includes Text and Plate
  1. Size: 24K.n\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
